@-moz-document domain("liquipedia.net") {

div, table > *, tr > *, button, .nav-tabs a, ul > li > span, .nav > li, .mw-editsection, .toc ul, .dropdown-menu, .main-nav {
  background-color: #1d1f21 !important;
  color: #c5c8c6 !important;
}

.main-nav {
    border-bottom: 1px solid #1c344d;
}

a, .nav > li > a, a:visited, a.nav-link > * {
  text-decoration: none;
  color: #81c2d7 !important;
  background: none !important;
}

a:hover, li > a:hover, a.nav-link > *:hover {
  text-decoration: none;
  color: #337ab7 !important;
  background: none !important;
}

a.new {
    color: #eaa8b4 !important;
}

a.selflink {
  border: none !important;
}
.nav > li, ul > li > span {
  border-color: #c5c8c6 !important;
}

.nav-tabs > li:not(.active) > a:not(.selflink) {
  border-bottom: 1px solid #ccc !important;
}

.wiki-bordercolor-light, .bdc-light, h1, h2, .nav-tabs {
  border-color: #c5c8c6
}

