}

button, .btn-primary {
    background-color: #151617 !important;
    border-color: #c5c8c6 !important;
    color: #c5c8c6;
}


.teamcard-toggle-button button {
    width: 120px;
    padding-right: 10px;
}

::-webkit-scrollbar {
    width: 10px;
}
::-webkit-scrollbar-track {
    background: #444; 
}
::-webkit-scrollbar-thumb {
    background: #222; 
}
::-webkit-scrollbar-thumb:hover {
